import SvgIcon from "@material-ui/icons/Print";
import { ReactComponent as Skull } from "./skull.svg";
import { ReactComponent as Bat } from "./bat.svg";
import { ReactComponent as Pumpkin } from "./pumpkin.svg";
import { ReactComponent as Atari } from "./atari.svg";
import { ReactComponent as Maze } from "./maze.svg";
import { ReactComponent as Tama } from "./tama.svg";
import { ReactComponent as Invader } from "./invader.svg";
import { ReactComponent as Coin } from "./coin.svg";
import { ReactComponent as ButtonRed } from "./buttonRed.svg";
import { ReactComponent as Textbox } from "./textbox.svg";
import { ReactComponent as Pacman } from "./pacman.svg";

import {
  Folder,
  Home,
  ColorLens,
  Pets,
  BugReport,
  WbSunny,
  SportsEsports,
  ArrowDropDown,
  ContactPhone,
  AcUnit,
} from "@material-ui/icons";
import {
  HomeOutline,
  AccountCircleOutline,
  WalletOutline,
  CalculatorVariantOutline,
  ToolboxOutline,
  CheckboxBlankCircle,
} from "mdi-material-ui";

import { GlobalThemes } from "../../ThemeManager";
import { useContext } from "react";
import { ThemeManagerContext } from "../../App";
const GetIcon: any = {
  Skull: Skull,
  Bat: Bat,
  Pumpkin: Pumpkin,
  Home: Home,
  Themes: ColorLens,
  Projects: Folder,
  Bug: BugReport,
  Paw: Pets,
  Sun: WbSunny,
  Atari: Atari,
  SportsEsports: SportsEsports,
  Tama: Tama,
  ArrowDropDown: ArrowDropDown,
  Invader: Invader,
  Contact: ContactPhone,
  AcUnit,
  HomeOutline,
  AccountCircleOutline,
  WalletOutline,
  CalculatorVariantOutline,
  ToolboxOutline,
  Coin,
  ButtonRed,
  Textbox,
  Pacman,
  PacmanCircle: CheckboxCircleOutline,
};
const Icon = ({
  icon,
  onclick,
  fontSize,
  color,
  viewBox,
}: {
  icon?: string;
  onclick?: (e: any) => void;
  fontSize?: number;
  color?: GlobalThemes;
  viewBox?: string;
}) => {
  const { themeManager, theme, setThemeContext } =
    useContext(ThemeManagerContext);
  const myIcon = GetIcon[icon as string];
  if (!myIcon) return <div></div>;
  return (
    <SvgIcon
      onClick={(e: any) => {
        return onclick ? onclick(e) : null;
      }}
      viewBox={viewBox ?? "0 0 24 24"}
      fontSize={fontSize ? "inherit" : "small"}
      style={{
        fontSize: fontSize ?? 24,
        color: color ?? "",
      }}
      component={myIcon}
    />
  );
};
export default Icon;
